import React from 'react';
import Card from './Card';

const CardList = ({ users }) => {
	const cardArray = users.map((user,i) => {
		return (<Card
		key = {i} 
		id = {users[i].id} 
		name  = {users[i].name}
		upload_date = {users[i].date}/>
	)})
	return (
		<div>
			{cardArray}
		</div>
	);
}

export default CardList;
